import React, { createElement, useEffect } from 'react';
import './css/Button.css';

function Button() {
  useEffect(() => {
    const main = document.getElementById('main');
    main.classList.add('cursor');
  });
  return (
    <div>
      <div>
        <a href="#" className="button">
          Button
        </a>
      </div>
    </div>
  );
}

export default Button;
